import React, { Component } from 'react'

class DateComponent extends Component {
    constructor() {
        super();

        var today = new Date(),
            date = today.getDate() + '-' + (today.getMonth() + 1) + '-' + today.getFullYear();

        this.state = {
            date: date,
            today : new Date()
        };
    }

    renderSwitch(param) {
        switch(param) {
          case 'foo':
            return 'bar';
          default:
            return 'foo';
        }
      }

    render() {
        return (
            <div>
                {today.getMonth()}
            </div>
        )
    }
}

export default DateComponent
